import React from 'react';
import logo from './logo.svg';
import './App.css';

import Home from './components/Home';
import { Routes, Route } from "react-router-dom";
import Nav from './components/Nav';
import AddEditTransaction from './components/AddEditTransaction';
import ListTransactionMonth from './components/ListTransactionMonth';


function App() {
  return (
    <div className="App">
      <Nav />
      <Routes>
        <Route path="/" element={<Home />}> </Route>
        <Route path="/addnewtransaction" element={<AddEditTransaction />}> </Route>
        <Route path="/month/january" element={<ListTransactionMonth />}> </Route>
        <Route path = "/edit-transaction/:id" component = {AddEditTransaction}></Route>
      </Routes>
    </div>
  );
}

export default App;
